import React from 'react'
import './index.less'
import {Card, Button, Icon, Form, Table, message} from 'antd'
import PageHeader from './PageHeader'
export default class Record extends React.Component {
    constructor(props) {
        super(props);
        this.state= {
            dataSource: []
        };
    }
    componentDidMount() {
        const dataSource = [
            {   
                id: '0',
                Flag: "true",
                Date: "2020/01/20",
                Institute: "UMPC",
                Department: "CMU",
                Dept_Phone: "765-325-6984",
                Status: "Finished"
            },
            {
                id: '1',
                Flag: "false",
                Date: "2020/01/20",
                Institute: "UMPC",
                Department: "CMU",
                Dept_Phone: "765-325-6984",
                Status: "Finished"
            },
            {
                id: '2',
                Flag: "true",
                Date: "2020/01/20",
                Institute: "UMPC",
                Department: "CMU",
                Dept_Phone: "765-325-6984",
                Status: "Finished"
            },
            {
                id: '3',
                Flag: "false",
                Date: "2020/01/20",
                Institute: "UMPC",
                Department: "CMU",
                Dept_Phone: "765-325-6984",
                Status: "Finished"
            },
            {
                id: '4',
                Flag: "false",
                Date: "2020/01/20",
                Institute: "UMPC",
                Department: "CMU",
                Dept_Phone: "765-325-6984",
                Status: "Finished"
            },
            {
                id:'5',
                Flag: "true",
                Date: "2020/01/20",
                Institute: "UMPC",
                Department: "CMU",
                Dept_Phone: "765-325-6984",
                Status: "Finished"
            }
        ];
        dataSource.map((item,index)=>{
            item.key = index;
        })
        this.setState({
            dataSource: dataSource
        })
    }

    render(){
        const columns = [
            {
              title: '',
              dataIndex: 'Flag',
              key: 'Flag',
              align: 'center',
            },
            {
              title: 'Date',
              dataIndex: 'Date',
              key: 'Date',
              align: 'center',
            },
            {
              title: 'Institute',
              dataIndex: 'Institute',
              key: 'Institute',
              align: 'center',
            },
            {
              title: 'Department',
              dataIndex: 'Department',
              key: 'Department',
              align: 'center',
            },
            {
                title: 'Dept_Phone',
                dataIndex: 'Dept_Phone',
                key: 'Dept_Phone',
                align: 'center',
            },
            {
                title: 'Status',
                dataIndex: 'Status',
                key: 'Status',
                align: 'center',
            },
        ];
        return (
            <div class="record-container">
                <PageHeader />
                <Card className="cardWrap" bordered={false}>
                    <Table
                        className="table-style"
                        loading={false}
                        dataSource={this.state.dataSource}
                        columns={columns}
                        aligh= {"center"}
                        rowClassName = {(record, index) => 'table-row-style'}
                    />
                </Card>
            </div>
        );
    }
}
